import React from 'react';
import Cruises from './cruises';


class Box extends React.Component{
    render(){
        return(



            <div id="box" style={{ backgroundColor: "#F8F8FF", borderRadius: "5px", position: "absolute", margin: "40px" }} >
               <div style={{paddingTop: "20px", paddingLeft:"20px"}}>
                    <h2>{this.props.head}</h2>
                    <h3>{this.props.sub}</h3>
                </div>

                <hr/>


                <ul style = {{display:"flex", listStyle: "none" , justifyContent:"space-around"}}>
                    <li style={{justifyContent:"space-around"}}><a href="#">HOTELS</a></li>
                    <li><a href="#">FLIGHTS</a></li>
                    <li><a href="#">BUNDLE + SAVE</a></li>
                    <li><a href="#">CARS</a></li>
                    <li><a href="#">CRUISES</a></li>
                </ul>


                 <Cruises />


                 <hr/>
                 <div style={{display: "flex", justifyContent:"center"}}>

                     <p>{this.props.footer} </p>
                     <a href="#"><b style={{color:"rgb(30, 144, 255)", marginLeft: "10px"}}>{this.props.footerb}</b></a>
                </div>



            </div>
        );
    }
}

export default Box;
